    public String getOrdenCed2() {
        String vOrdenCedula,pOrden;
        
        vOrdenCedula="";
        if (this.getOrdenCedula() !=null)
        {
          pOrden=this.getOrdenCedula();
        
          if (pOrden.equals("A1"))
            vOrdenCedula="A01";
          else if (pOrden.equals("B2"))  
            vOrdenCedula="B02";
          else if (pOrden.equals("C3"))  
            vOrdenCedula="C03";  
          else if (pOrden.equals("D4"))  
            vOrdenCedula="D04";    
          else if (pOrden.equals("E5"))  
            vOrdenCedula="E05";    
          else if (pOrden.equals("F6"))  
            vOrdenCedula="F06";
          else if (pOrden.equals("G7"))  
            vOrdenCedula="G07";  
          else if (pOrden.equals("H8"))  
            vOrdenCedula="H08";    
          else if (pOrden.equals("I9"))  
            vOrdenCedula="I09";      
          else
              vOrdenCedula=pOrden;        
            
        }    
        
         return vOrdenCedula;
    }

